    for (var key in jsonSavedKeyPairs)
    {
        if (exports.coinsInfo[jsonSavedKeyPairs[key].network] != exports.coinsInfo[network])
            continue;
            
        const nextBalance = parseFloat(jsonSavedKeyPairs[key].balance);
        if (!isNaN(nextBalance))
            ret += nextBalance;
    }
    return ret;
